text:
Donald Trump and FCC Chair Brendan Carr are threatening the fundamental American right to free speech.

@jimmykimmel exercised his 1st Amendment right to state his opinion and was taken off the air because of pressure from Trump and Carr. No one should bend the knee to Trump. 

I signed on to @RepYassAnsari’s resolution to condemn these attacks on free speech because this is America — we don’t ban speech just because the president doesn’t like it.

House Democrats step up, once again, to stop the Republican health care crisis. 

@HouseDemocrats have proposed legislation that cancels the cuts to health care, lowers the costs, and saves your health care. 

Legislation should work for the people, not against them. https://t.co/jIV4NG7qs9

At #Wilmington’s annual Labor Day Parade, we celebrated our brothers and sisters of labor! 

While we celebrate our workers and labor unions every day, #LaborDay2025 is a great reminder that we must continue to fight for workers’ fair wages, benefits, and working conditions, even as the Trump administration tries to take away rights like collective bargaining. 

@HouseDemocrats stand with labor— you deserve to be recognized and rewarded for your hard work.

Trump & House Republicans’ Big Ugly Law will make it more difficult for our young students to pursue advanced professional degrees — especially students from disadvantaged communities. This means we could lose out on talented future American doctors and other professionals. 

@HouseDemocrats will keep fighting to support the dreams of our American students who want to give back to our communities. 

https://t.co/S5OF248Fb0

Republicans voted against their constituents’ interest and for Trump’s Big Ugly Bill. States like Louisiana heavily rely on Medicaid — but Speaker Johnson and Majority Leader Scalise celebrated taking health care away from their constituents.

@HouseDemocrats believe ALL Louisianans deserve health care. Leader @RepJeffries and the Steering & Policy Committee were on the road, hosted by @reptroycarter, in New Orleans last week to hear directly from Louisianans about how devastating these cuts will be to people throughout their state.

https://t.co/z91H4Mk2df

The Big Ugly Bill is a moral failure. It’s an assault on the American people — on children, seniors, veterans, and people with disabilities. It strips away health care, food assistance, and basic dignity from those who need it most to hand nearly $1.3 trillion in tax breaks to billionaires like Elon Musk. 

@HouseDemocrats fought like hell to stop this bill. But in the end, Republicans in Congress chose to serve Trump and their donors over their country and constituents. 

Republicans didn’t just fail our families today, they betrayed the American people. House Democrats will never stop fighting to reverse this damage and protect the people we were sent here to serve.

Republicans choose MORE tax breaks for their billionaire donors over children and their health.

Trump’s Big Ugly Bill will kick millions of Americans, including children, off their Medicaid health insurance. 

@HouseDemocrats are fighting like hell to stop this — but it’s going to take a few Republicans to grow a spine and vote NO to prevent them from stealing health care from children.

Hospitals like Torrance Memorial play an essential role in providing quality health care to our communities.

Republicans’ Big, Ugly Bill will hurt hospitals — forcing some to close or reduce services. It will rip away healthcare from millions which means more Americans will end up in the emergency room— that will hurt us all.

@HouseDemocrats will continue to fight to save our hospitals and protect access to affordable health care for working Americans.

Trump said he would lower prices —instead he’s made prices go up. Now Trump says a traffic slowdown at our ports “is a good thing.” 

Mr. President, it is NOT a good thing & will further increase prices. Your tariffs are causing layoffs, less shifts, & less work at our ports, surrounding communities, and throughout the region —making life more expensive for every American family at the checkout line. 

@HouseDemocrats will continue to shine a light on how Trump and House Republicans’ dangerous policies are harming the American people.

My constituent, Brian Gutierrez, lives in South Gate and has Spina Bifida, a lifelong disability. Medicaid has been the difference between life and death for Brian. I was proud to share his story on the House floor. 

The Republican budget will risk the lives and health of millions of Americans across the country. 

@HouseDemocrats will continue to amplify the people’s message — KEEP YOUR HANDS OFF MEDICAID.

“BAD” just about sums up the effect of the #TrumpTax on our local businesses. 

The @ramirezranchmarket in #NorthLongBeach tries to deliver the most affordable grocery prices to their customers — that’s why they’re worried about the Trump Tax driving up the prices of so many items in their store. If the price they pay to stock their shelves with goods drastically rises, they can’t keep prices affordable for our #CA44 communities.

@HouseDemocrats continue to share our constituents’ stories during our Cost of Living Week of Action to show how Trump and House Republicans’ policies make hardworking Americans pay more for everyday essentials.

WTF is happening to our Medicaid and Social Security?
 
@RepEmilyRandall and I will host the WTF Show today (LIVE!) to discuss what is happening in Washington, how it will affect you, and how @HouseDemocrats fight back against Donald Trump, Elon Musk, and House Republicans to protect programs that provide care and services you deserve.
 
Tune in (4 PM EST/ 1 PM PST): https://t.co/fp2LLJHppb

House Republicans traded away Medicaid and food stamps for hardworking Americans to give huge tax breaks for Elon Musk and their billionaire donors.

They voted to pass a budget that guts billions and billions of dollars from essential services — stealing money from the pockets of seniors, children, people with disabilities, and working families. 

@HouseDemocrats were united in our fight against this harmful budget - and we’re not done.

Trump “couldn't care less" about hardworking Americans paying more for their cars and trucks. He said it himself.

Trump and Republicans in Congress want to cause more pain for hardworking American families who already struggle with high prices - while also giving huge tax breaks to their billionaire donors.

@HouseDemocrats are fighting to bring prices down for all Americans. Notice the difference.

Trump claims he will not cut Social Security, but Elon Musk and DOGE have already caused chaos at the Social Security Administration – and beneficiaries are already seeing the impacts: increased phone wait times, canceled disability hearings, and delayed review of disability claims.

Americans’ hard-earned benefits are under attack while Trump and House Republicans are trying to give tax breaks to billionaires.
 
@HouseDemocrats are fighting back to protect Social Security for over 70 million Americans who depend on these benefits.

Trump thinks firing federal workers & Veterans makes America “great”. This is not true. 
 
@elonmusk & his reckless DOGE cuts to agency staff & programs means fewer food safety inspectors, delayed disaster relief, missed Social Security checks & understaffed VA hospitals. 
 
This does nothing to reduce inflation & causes chaos in our economy #SOTU

Seven years ago, 17 lives were lost and 17 injured in a senseless mass shooting in Parkland, FL. I toured Marjory Stoneman Douglas High School with @RepMoskowitz a couple of years ago. I will carry those images with me for the rest of my life.

We remember the lives lost and the Parkland community impacted by this tragedy.

@HouseDemocrats continue to press for commonsense gun safety legislation that protects our kids and educators from gun violence. We need cooperation from our colleagues to get this done. #EndGunViolence

Donald Trump & Republicans in Congress are stealing from you to reward their billionaire donors. 
 
Elon Musk has been given access to your personal information. They want you to pay more for gas & groceries with reckless tariffs. They want to end Medicaid as we know it—just to hand trillions in tax breaks to billionaires & corporations.
 
@HouseDemocrats are fighting to protect your rights, your health care, and your wallet. #RepublicanRipOff

Today, Congress certified the 2024 election results & ensured the peaceful transfer of power to the new Administration. 

Democrats are not election deniers. Unlike 4 years ago, there were no unconstitutional attempts to undermine our democracy. 

@HouseDemocrats will uphold the rule of law, and continue to fight for American families.
